            this.setState({ user: this.props.user })
        } else {
            <Redirect to="/signup" />
        }
    }
    componentWillUnmount() {
        this.setState({ user: {} })
    }


    render() {
        return (
            <div>Hello World</div>
        );
    }

}

export default GameContainer
